    data: |
      SELECT NULLIF ( + CAST ( + - 83 AS INTEGER ), - CASE + COUNT ( * ) WHEN - 50 / 4 / - - 85 THEN NULL ELSE + ( + + 82 ) * AVG ( 42 ) END );

outputs:
  - name: q10096.out
    data: |
      -83
